import React from 'react';
import logo from '../src/assets/img/Original.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <nav className="navbar navbar-expand-sm navbar-toggleable-sm navbar-light bg-white border-top box-shadow">
            <img src={logo} className="App-logo" alt="logo" />
            <p>
              Experts with you.
            </p>
          </nav>
      </header>


      <footer className="border-top footer text-muted">
        <div className="container">
          &copy; 2020
        </div>
      </footer>

    </div>


  );
}

export default App;
